import React from "react";
import { useSelector } from "react-redux";

export default function OrderHistory() {
  const states = useSelector((state) => state.OrderDataHistory.orders);
  console.log("order Data history", states);

  return (
    <div>
      <h1>{states.id}</h1>
    </div>
  );
}
